import React from 'react';

import Button from '../UI/Button/Button';
import styles from './ContactForm.module.css';

function contactForm() {
  return (
    <form className={styles.form}>
      <fieldset className={styles.fieldset}>
        <legend className={styles.legend}>Свяжитесь с нами</legend>
        <input className={styles.formField} type='text' placeholder='Ваше Имя' />
        <input className={styles.formField} type='number' placeholder='Ваше Телефон' />
        <input className={styles.formField} type='email' placeholder='Ваше E-mail' />
        <textarea className={styles.formField} placeholder='Сообщение'></textarea>
        <Button type='submit'>Отправить</Button>
      </fieldset>
    </form>
  )
}

export default contactForm
